import React, { Component } from 'react';
import { Link } from 'react-router-dom';

const NavBarItem = (props) => {

        return (
            <div>
                <Link 
                className={`nav-item nav-link ${props.item.active ? "active" : ""}`}
                to={props.item.href} 
                onClick={() => props.item.onClick(props.item)}>
                {props.item.name}
                 </Link>
            </div>
        );
    }

export default NavBarItem;
